hebsuperobject.biblemap.put("b22_7_9", new hebsuperobject(22,7,9,"וחכך כיין הטוב הולך לדודי למישרים דובב שפתי ישנים׃"));
hebsuperobject.biblemap.put("b22_7_10", new hebsuperobject(22,7,10,"אני לדודי ועלי תשוקתו׃"));
hebsuperobject.biblemap.put("b22_7_11", new hebsuperobject(22,7,11,"לכה דודי נצא השדה נלינה בכפרים׃"));
hebsuperobject.biblemap.put("b22_7_12", new hebsuperobject(22,7,12,"נשכימה לכרמים נראה אם פרחה הגפן פתח הסמדר הנצו הרמונים שם אתן את דדי לך׃"));
hebsuperobject.biblemap.put("b22_7_13", new hebsuperobject(22,7,13,"הדודאים נתנו ריח ועל פתחינו כל מגדים חדשים גם ישנים דודי צפנתי לך׃"));
hebsuperobject.biblemap.put("b22_8_1", new hebsuperobject(22,8,1,"מי יתנך כאח לי יונק שדי אמי אמצאך בחוץ אשקך גם לא יבוזו לי׃"));
hebsuperobject.biblemap.put("b22_8_2", new hebsuperobject(22,8,2,"אנהגך אביאך אל בית אמי תלמדני אשקך מיין הרקח מעסיס רמני׃"));
hebsuperobject.biblemap.put("b22_8_3", new hebsuperobject(22,8,3,"שמאלו תחת ראשי וימינו תחבקני׃"));
hebsuperobject.biblemap.put("b22_8_4", new hebsuperobject(22,8,4,"השבעתי אתכם בנות ירושלם מה תעירו ומה תעררו את האהבה עד שתחפץ׃"));
hebsuperobject.biblemap.put("b22_8_5", new hebsuperobject(22,8,5,"מי זאת עלה מן המדבר מתרפקת על דודה תחת התפוח עוררתיך שמה חבלתך אמך שמה חבלה ילדתך׃"));
hebsuperobject.biblemap.put("b22_8_6", new hebsuperobject(22,8,6,"שימני כחותם על לבך כחותם על זרועך כי עזה כמות אהבה קשה כשאול קנאה רשפיה רשפי אש שלהבתיה׃"));
hebsuperobject.biblemap.put("b22_8_7", new hebsuperobject(22,8,7,"מים רבים לא יוכלו לכבות את האהבה ונהרות לא ישטפוה אם יתן איש את כל הון ביתו באהבה בוז יבוזו לו׃"));
hebsuperobject.biblemap.put("b22_8_8", new hebsuperobject(22,8,8,"אחות לנו קטנה ושדים אין לה מה נעשה לאחתנו ביום שידבר בה׃"));
hebsuperobject.biblemap.put("b22_8_9", new hebsuperobject(22,8,9,"אם חומה היא נבנה עליה טירת כסף ואם דלת היא נצור עליה לוח ארז׃"));
hebsuperobject.biblemap.put("b22_8_10", new hebsuperobject(22,8,10,"אני חומה ושדי כמגדלות אז הייתי בעיניו כמוצאת שלום׃"));
hebsuperobject.biblemap.put("b22_8_11", new hebsuperobject(22,8,11,"כרם היה לשלמה בבעל המון נתן את הכרם לנטרים איש יבא בפריו אלף כסף׃"));
hebsuperobject.biblemap.put("b22_8_12", new hebsuperobject(22,8,12,"כרמי שלי לפני האלף לך שלמה ומאתים לנטרים את פריו׃"));
hebsuperobject.biblemap.put("b22_8_13", new hebsuperobject(22,8,13,"היושבת בגנים חברים מקשיבים לקולך השמיעיני׃"));
hebsuperobject.biblemap.put("b22_8_14", new hebsuperobject(22,8,14,"ברח דודי ודמה לך לצבי או לעפר האילים על הרי בשמים׃"));

